import { Typography } from "@mui/material";
import Navigation from "components/Navigation";
import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div className="home">
        <Navigation />
        <Typography
          sx={{
            position: "absolute",
            width: "911px",
            height: "137px",
            left: "264px",
            top: "164px",
            fontFamily: "Libre Baskerville",
            fontStyle: "normal",
            fontWeight: 400,
            fontSize: "98px",
            lineHeight: "140%",
            letterSpacing: " -0.02em",
            display: "grid",

          }}
        >
          Conquer the forest
        </Typography>
      </div>
    );
  }
}

export default Home;
